import { Route, Routes } from "react-router-dom";

export function EmployeeRoute() {
  return (
    <Routes>
      <Route index element={<EmployeeList />} />
      <Route path="create" element={<CreateEmployee />} />
      <Route path=":id" element={<GetEmployee />} />
    </Routes>
  );
}
